widgets_values:
// <NAME>_TYPE: have the uniform type
uniform U_TEX0_TYPE u_tex0;
uniform U_TEX0_TYPE u_tex1;

uniform vec2    u_resolution;
uniform float   u_time;
uniform float   u_fps;
uniform int     u_frame;

// This overwrites all LYGIA sampling functions
#define SAMPLER_TYPE U_TEX0_TYPE
#define SAMPLER_FNC(TEX, UV) sampleTexture(TEX, UV)
vec4 sampleTexture(U_TEX0_TYPE tex, vec2 st) {
    #ifdef U_TEX0_TOTALFRAMES
    return texture(tex, vec3(st, float(u_frame)));
    #else
    return texture(tex, st);
    #endif
}


void main() {
    vec4 color = vec4(0.0, 0.0, 0.0, 1.0);
    vec2 pixel = 1.0 / u_resolution;
    vec2 st = gl_FragCoord.xy * pixel;
    vec2 flow = sampleTexture(u_tex1, st).xy * 2.0 - 1.0;

    color = sampleTexture(u_tex0, st);
    color += sampleTexture(u_tex1, st);

    gl_FragColor = color;
}
